ignment The sending sensor which has the yellow light transmits the infrared beam to the receiving sensor which has a green light.";i:38;s:53:"The yellow sending sensor light should always be lit.";i:39;s:49:"Garage Door Opener Flashing Led Light Not Moving.";i:40;s:57:"Liftmaster And Genie Garage Door Opener Sensor Eye Issue.";i:41;s:58:"Garage Doors Emergency Troubleshooting For Openers Garaga.";i:42;s:49:"Garage Door Opener Flashing Led Light Not Moving.";i:43;s:67:"7881 Part 15 Spread Spectrum Transceiver User Manual 114a4503 Indd.";i:44;s:61:"Chamberlain Garage Door Opener 3280 267 Rapid And Continuous.";i:45;s:69:"Store like Home Depot or Lowes or from a garage door service company.";i:46;s:17:"You will need to.";i:47;s:89:"Unplug your garage door opener from the power source to prevent accidental electrocution.";i:48;s:90:"Remove the old safety eyes noting how they connect to the back of the operator mounted on.";i:49;s:31:"The ceiling of the garage door.";i:50;s:54:"Replace the opener sensors following the manufacturer.";i:51;s:65:"The garage door sensor yellow sending light should always be lit.";i:52;s:152:"An easy way to tell if your garage door sensors are out of alignment is by checking if the exterior LED light blinks when you attempt to close the door.";i:53;s:96:"Green lights mean the sensors are working while red lights indicate the sensors are not aligned.";i:54;s:63:"The lights on your sensors indicate if theyre working properly.";i:55;s:91:"Most garage door sensors will have one yellow and one green light when theyre in alignment.";i:56;s:62:"Genie garage door openers may also have a green and red light.";i:57;s:52:"All you need to do is check if the lights are solid.";i:58;s:199:"If you own a garage door opener by Lift Master Chamberlain or Craftsman youll notice that the sender sensor will usually shine a yellow light and the receiver sensor will usually shine a green light.";i:59;s:136:"If you see that the sender sensor is not yellow and the receiver sensor is not green then this means that your sensors are probably off.";i:60;s:108:"Garage door sensors utilize a photo-eye sensor and a beam of infrared light that goes between the two units.";i:61;s:71:"The units are placed near the ground on either side of the garage door.";i:62;s:105:"If the beam of light is interrupted while the garage door is closing the door will stop and rise back up.";i:63;s:108:"Genie garage door openers use a green light for the sending sensor and a red light for the receiving sensor.";i:64;s:83:"When Genie safety sensors are misaligned the red receiving sensor light will blink.";i:65;s:148:"This is a nice feature because if the light is blinking then you know you have power going to the receiving sensor all you have to do is align them.";}}